import React from "react";
import { YMaps, Map as YandexMap, Placemark } from 'react-yandex-maps'; // Здесь поменял имя компонента Map на YandexMap
const MapComponent = () => { // Здесь также поменял имя компонента на MapComponent
  return (
    <YMaps query={{apikey: 'c8b9e28d-92e5-436f-a252-fe89b025381f'}}>
            <YandexMap defaultState={{ center: [55.75, 37.57], zoom: 9 }}> {/* Здесь использую новое имя YandexMap */}
                <Placemark geometry={[55.75, 37.57]} />
            </YandexMap> {/* Здесь использую новое имя YandexMap */}
    </YMaps>
  );
}

export default MapComponent; // Здесь также поменял имя компонента на MapComponent
